import jsonPlaceholder from "../apis/jsonPlaceholder";
import { FETCH_POSTS } from "./actionsTypes";
import { DispatchType, IPost, PostAction } from "../AppTypes";

export const fetchPosts: any = () => async (dispatch: DispatchType) => {
    const response = await jsonPlaceholder.get("/posts");
    const posts: IPost[] = response.data;
    const status: number = response.status;

    console.log("fetchPosts response");
    console.log(response);

    const action: PostAction = {
        type: FETCH_POSTS,
        payload: { posts, status },
    };

    //setTimeout(function () {
    dispatch(action);
    //}, 3000);
};
